import Contacts from "./components/Contacts"

const App = ( {contacts} ) =>
{

  return (

    <div>

		<h2>Phonebook</h2>

      		<ul>
        		{contacts.map(contact => 
          			<Contacts key={contact.id} contact={contact} />
        		)}
      		</ul>

    </div>

  );
}

export default App;
